export function TodoList( todos ){
    return(
    <ul className='list'>
        {todos.map(todo => {
          return (
            <li key={todo.key}>
              <label>
                <input type='checkbox' checked={todo.completed} onChange={e => ToggleTodo(todo.id, e.target.checked)} />
                {todo.title}
              </label>
              <button onClick={()=> DeleteTodo(todo.id)} className='del-btn'>Delete</button>
            </li>
          )
        })}
      </ul>
    )
}
